syntax = "proto3";

option java_package = "emu.grasscutter.net.proto";


// Name: EHFBOLNJEAC
message HomeBlueprintSlotInfo {
    uint32 scene_id = 10;
    uint32 create_time = 13;
    uint32 slot_id = 12;
    uint32 module_id = 4;
    uint32 block_id = 11;
    bool is_allow_copy = 5;
    string share_code = 7;
}

